import React, {Component} from 'react';
import MainTemplate from '../layouts/Main';

class AboutPage extends Component {
    render() {
        return (
            <MainTemplate>
                <h1>It all about us!</h1>
            </MainTemplate>
        );
    }
}

export default AboutPage;
